import React from "react";
class App extends Component{
    render() {
        return (<Fragment>
                 <div className={"App"}>
                    1
                </div>
                <div className={"SOSO"}>
                2
                </div>
                <div className={"MID"}>
                        3
                </div>
                <div className={"HEA"}>
                4
                </div>
            </Fragment>
        )
    }

}

export default App;
